import React from 'react';
import { View } from 'react-native';
import {Text} from 'react-native';

const Gato = () => {
  return (
    <View>
      <Text>Yotambien  gato!</Text>
    </View>
  );
}

const Felino = () => {
  return (
    <View>
      <Text>Hola, soy un felino!</Text>
    <Gato/>
    <Gato/>
    <Gato/>
    </View>
  )
}

export default Gato;
